взрывозащищенные датчики для наших объектов, а не использовать продукты сторонних производителей. Так вот, сказано — сделано.
Теперь у нас есть пилотная партия, 190 штук, которые мы тестируем на протяжении полугода. Старт пришёлся на ноябрь 2019 года, когда мы установили достаточно большое количество датчиков в Тобольске, чтобы посмотреть, как они работают в боевых условиях, и собрать полноценную статистику. Полгода спустя мы можем точно сказать, что идея делать всё самим была правильной и оправдалась — они нормально прошли боевое крещение зимой (а зима в тех краях, где стоят наши объекты, весьма и весьма серьезная штука). Значит, будем выпускать такие датчики в тираж.
Что это за датчики и зачем они нужны
Прежде всего — это датчики, которые измеряют как температуру рабочих поверхностей, так и температуру объектов. Поэтому датчики должны работать в вилке температурных условий от -56 
до +50 градусов по Цельсию. Мы поставили их на производство пиролиза ЗапСибНефтехима, чтобы защищать от замерзания трубы теплоспутников (второстепенные по значимости объекты производства). До введения системы датчиков этот контроль осуществлялся людьми, которые ходили и руками трогали эти трубы на предмет «замерзло — не замерзло».');


