INSERT INTO posts (user_id, head, body) VALUES (27, 'Распределённый АД', 'Полгода назад в третьем выпуске подкаста «Сушите вёсла» мы немного предсказали будущее. Точнее, в эфире мы обсудили удалённую работу распределённых команд, а сейчас это оказалось одной из горячих тем в ИТ-мире. ');
INSERT INTO posts (user_id, head, body) VALUES (65, 'Беспроводная точка доступа vs роутер: в чем различия?', ' В 9:00 утра: Вы проводите видеоконференцию в офисе через ноутбук. 9:00 вечера: Вы смотрите прямую трансляцию на своем мобильном телефоне дома. Подождите минуту, вы когда-нибудь задумывались о том, какие беспроводные устройства работают в вашей беспрепятственной сети? Конечно, вы слышали, как окружающие вас люди время от времени говорят о роутере. Как насчет беспроводных точек доступа (точек доступа)? Это так же, как роутер? Абсолютно нет! Ниже мы поможем вам отличить два разных беспроводных сетевых устройства.
INSERT INTO posts (user_id, head, body) VALUES (15, 'Вы знаете английский? Узнайте, насколько далеко вы могли бы отправиться в прошлое', 'Язык — это пластичная система, которая постоянно изменяется. Но эти изменения незаметны обычному человеку — для них требуются десятилетия и даже века.
INSERT INTO posts (user_id, head, body) VALUES (70, 'Маркетинг в Telegram по-узбекски', 'Думаю, многие из тех, кто занимался продвижением в Телеграм, слышали об «узбекских каналах». Это словосочетание часто используют не только в прямом, но и в переносном смысле. И в этом случае «узбекский» значит «низкокачественный». Хочу рассказать вам свою историю рекламы в одном из таких каналов и поделиться полученным (горьким) опытом.');
